--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `spBuscarVenta` (IN `idUsuario` INT(4), IN `codEstado` VARCHAR(8), IN `idCampania` INT(4), IN `abilitarFechas` INT(1), IN `dFechaIn` DATETIME, IN `dFechaFin` DATETIME)  BEGIN
    	SELECT V.idventa,V.cCodVenta,c.nombresCliente,SUBSTRING_INDEX(SUBSTRING_INDEX(c.apellidosCliente, ' ', 1), ' ', -1) AS apellido,v.fecha_registroV,v.numeroCuotasV,CONCAT(tm.SimboloMoneda,v.totalV) as total,tc.cCodTab estadoVenta,tc.cNomTab,p.per_nombre
        FROM venta v 
        INNER JOIN clientes c ON v.fk_IdAlumno=c.idCliente
        INNER JOIN tipomoneda tm ON tm.idTipoMoneda=v.fk_tipoMoneda
        INNER JOIN usuarios u ON u.idUsuario=v.idUsuario
        INNER JOIN personal p ON p.idPersonal=u.ID_PERSONAL
        INNER JOIN campaniassmtk cm ON cm.idCampania=v.fk_idCampania
        INNER JOIN tablacod tc ON tc.cCodTab=v.estadoVenta
        WHERE ((idUsuario=0) OR(v.idUsuario= idUsuario))
        AND ((idCampania=0) OR (v.fk_idCampania=idCampania))
        AND ((codEstado='0') OR (v.estadoVenta=codEstado))
        AND ((abilitarFechas=0) OR (v.fecha_registroV BETWEEN dFechaIn AND DATE_ADD(dFechaFin, INTERVAL 1 DAY)));
 END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_actualizarCurso` (IN `dtFechaIni` DATETIME, IN `dtFechaFin` DATETIME, IN `cCodProgreso` VARCHAR(8), IN `cCodAlumno` VARCHAR(15), IN `cCodVenta` VARCHAR(15))  BEGIN
     UPDATE clase_realizar cr 
     SET cr.fechaInicio=dtFechaIni,
     	cr.fechaFinal=dtFechaFin,
        cr.progresoClase=cCodProgreso
    WHERE cr.fk_codAlumno=cCodAlumno
    	AND cr.fk_codVenta=cCodVenta;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_actualizarInicioCurso` (IN `dtFechaEntrante` DATETIME)  BEGIN 
UPDATE clase_realizar cr 
SET cr.progresoClase='PCLA0002'
WHERE ((cr.fechaInicio=dtFechaEntrante) OR (cr.fechaInicio<dtFechaEntrante));
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_listarPersonal` ()  BEGIN
    SELECT u.idUsuario,CONCAT(p.per_nombre," ",p.per_apellido_paterno) AS personal
    FROM personal p
    INNER JOIN usuarios u ON u.ID_PERSONAL=p.idPersonal
    INNER JOIN cargos c ON u.ID_CARGO=c.idCargo
    WHERE u.ID_CARGO=3;
    END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pruebas` ()  BEGIN
SELECT p.per_nombre
FROM personal p;
END$$

