DELIMITER $$
CREATE TRIGGER `Generar_codigoPros` BEFORE INSERT ON `prospectos` FOR EACH ROW begin
	declare siguiente_codigo int;
    set siguiente_codigo = (Select ifnull(max(convert(substring(pros_codigo, 3), signed integer)), 0) from prospectosunicos) + 1;
    set new.pros_codigo = concat('PS', LPAD( siguiente_codigo, 8, '0'));
end
$$
DELIMITER ;

